UPDATE oxarticles SET OXDELTIMEUNIT = '';
UPDATE oxarticles SET OXDELTIMEUNIT = 'DAY' ORDER BY RAND() LIMIT 106;
UPDATE oxarticles SET OXDELTIMEUNIT = 'WEEK' WHERE OXDELTIMEUNIT = '';

